import React from 'react';
import styled from 'styled-components';
import Paragraf from './ParagrafMain.js';
import Link from '../../Link.js';
import '../../Nav/GlobalNav.js';
// import SubTitles from '../SubTitle.js';
import Browser from '../../../img/browser.svg';



const Container = styled.div`
    width: 483px;
    height: 370px;
    padding: 45px 40px;
    position: relative;
    background: #87BBFD;
    position: relative;
    img{
        width: 526px;
        position: absolute;
        top: 0;
    }
`
const InContainer = styled.div`
    width: 403px;
    height: 242px;
    padding: 20px;
    position: absolute;
    bottom: 0px;
    background: #fff;
`


class ImageCheckout extends React.Component {
  render(){
    return (
        <Container>
            <img src={Browser} alt="back"/>
            <InContainer>

            </InContainer>
        </Container>
    );
  }
}
export default ImageCheckout;
